import React, { Component } from 'react';


class Header extends Component {
    render() {
        return (
            <header>
                <div className="menu">
                    <nav>
                        <ul>
                            <li><a href='#'>Home</a></li>
                            <li><a href='#'>Sobre</a></li>
                            <li><a href='#'>Contato</a></li>
                        </ul>
                    </nav>
                </div>
            </header>
        )
    }
}


export default Header
